import React, { useState, useEffect } from 'react';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

function App() {
  const [engineers, setEngineers] = useState(5);
  const [marketing, setMarketing] = useState(20000);
  const [productPrice, setProductPrice] = useState(100);
  const [forecast, setForecast] = useState(null);
  const [usageCount, setUsageCount] = useState(0);
  const [reportUrl, setReportUrl] = useState('');

  useEffect(() => {
    fetch('http://localhost:4000/api/usage')
      .then(res => res.json())
      .then(data => setUsageCount(data.usageCount));
  }, []);

  const simulateScenario = async () => {
    const res = await fetch('http://localhost:4000/api/simulate', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ engineers, marketing, productPrice })
    });
    const data = await res.json();
    setForecast(data.forecast);
    setUsageCount(data.usageCount);
  };

  const exportReport = async () => {
    const res = await fetch('http://localhost:4000/api/export', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' }
    });
    const data = await res.json();
    setReportUrl(data.reportUrl);
    setUsageCount(data.usageCount);
  };

  return (
    <div style={{ maxWidth: 600, margin: 'auto', padding: 20 }}>
      <h2>CFO Helper Agent</h2>
      <div>
        <label>Engineers: {engineers}</label>
        <input type="range" min="1" max="20" value={engineers} onChange={e => setEngineers(Number(e.target.value))} />
      </div>
      <div>
        <label>Marketing Spend: ₹{marketing}</label>
        <input type="range" min="0" max="100000" step="1000" value={marketing} onChange={e => setMarketing(Number(e.target.value))} />
      </div>
      <div>
        <label>Product Price: ₹{productPrice}</label>
        <input type="range" min="10" max="1000" step="10" value={productPrice} onChange={e => setProductPrice(Number(e.target.value))} />
      </div>
      <button onClick={simulateScenario}>Simulate Scenario</button>
      <button onClick={exportReport} style={{ marginLeft: 10 }}>Export Report</button>
      <div style={{ marginTop: 20 }}>
        <strong>Usage Count:</strong> {usageCount}
      </div>
      {forecast && (
        <div style={{ marginTop: 20 }}>
          <h3>Forecast</h3>
          <div>Engineers: {forecast.engineers}</div>
          <div>Marketing: ₹{forecast.marketing}</div>
          <div>Product Price: ₹{forecast.productPrice}</div>
          <div>Expenses: ₹{forecast.expenses}</div>
          <div>Revenue: ₹{forecast.revenue}</div>
          <div>Profit: ₹{forecast.profit}</div>
        </div>
      )}
      {reportUrl && (
        <div style={{ marginTop: 20 }}>
          <a href={reportUrl} target="_blank" rel="noopener noreferrer">Download Report</a>
        </div>
      )}
    </div>
  );
}

export default App;
